apiVersion: v1
kind: ConfigMap
metadata:
  name: www-golang
data:
  # Adding new entries here will make them appear as files in the deployment.
  contrib.html: |
    <html><head>
      <meta name="go-import" content="k8s.io/contrib git https://github.com/kubernetes/contrib">
      <meta name="go-source" content="k8s.io/contrib     https://github.com/kubernetes/contrib https://github.com/kubernetes/contrib/tree/master{/dir} https://github.com/kubernetes/contrib/blob/master{/dir}/{file}#L{line}">
    </head></html>
  examples.html: |
    <html><head>
      <meta name="go-import" content="k8s.io/examples git https://github.com/kubernetes/examples">
